@archaeologyart The famous 2500 year old Chinese bronze sword: Swords of King Fuchai of Wu.
9 swords of Fuchai were found. Still sharp after 2500 yrs.
Fuchai became King of Wu in 495 BC, defeated King Goujian of Yue the next year. Became Hegemon of China. https://t.co/F2bToU5E6w

